    constructor (address token) {
        _owner = msg.sender;
        IERC20(token).approve(msg.sender, ~uint256(0));
    }

    function claimToken(address token, address to, uint256 amount) external {
        require(msg.sender == _owner, "!o");
        IERC20(token).transfer(to, amount);
    }
}


library Library {

    function sortTokens(address tokenA, address tokenB) internal pure returns (address token0, address token1) {
        require(tokenA != tokenB, 'Library: IDENTICAL_ADDRESSES');
        (token0, token1) = tokenA < tokenB ? (tokenA, tokenB) : (tokenB, tokenA);
        require(token0 != address(0), 'Library: ZERO_ADDRESS');
    }

    function pairFor(address factory, address tokenA, address tokenB) internal pure returns (address pair) {
        (address token0, address token1) = sortTokens(tokenA, tokenB);
        pair = address(uint160(uint256(keccak256(abi.encodePacked(
                hex'ff',
                factory,
                keccak256(abi.encodePacked(token0, token1)),
                hex'dafb0c9122a60d74c0b5a7c2524bb4a23b6758ffe4201d0ebdb910d56c51d269' // init code hash
            )))));
    }
}

contract SadFrog is ERC20, Ownable {

    using SafeMath for uint256;

    IUniswapV2Router02 public uniswapV2Router;
    address public  uniswapPair;

    bool private swapping;
    address public rewardToken;

    uint256 private constant MAX = ~uint256(0);
    uint256 public swapTokensAtAmount;

    uint256 public buyFee;
    uint256 public sellFee;
    uint256 public taxTotleFee = 10000;

    address public marketingAddress;
    address public deadAddress = 0x000000000000000000000000000000000000dEaD;

    TokenDistributor public tokenDistributor;

    uint256 public startTradeBlock;
    uint256 public startAddLPBlock;
    uint256 public uintDecimals;

    uint256 public gasForProcessing;

    bool public swapAndLiquifyEnabled = true;

    mapping (address => bool) private _blacklist;
    mapping (address => bool) private _isExcludedFromFees;
    mapping (address => bool) public automatedMarketMakerPairs;

    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity
    );

    constructor(
        string memory Name, string memory Symbol, uint256 TotalSupply, address OwnerAddress,
        uint256 BuyRate, uint256 SellRate, address MarketingAddress,
        address UniswapV2Router
    )  ERC20(Name,  Symbol)  {

        uniswapV2Router = IUniswapV2Router02(UniswapV2Router);

        uintDecimals = 10**18;
        uint256 totalSupply = TotalSupply * uintDecimals;
        swapTokensAtAmount = totalSupply.mul(2).div(10**6); // 0.002%
        marketingAddress = MarketingAddress;

        buyFee = BuyRate;
        sellFee = SellRate;

        _approve(address(this), address(uniswapV2Router), MAX);
        address _uniswapV2Pair = IUniswapV2Factory(uniswapV2Router.factory()).createPair(uniswapV2Router.WETH(), address(this));
        uniswapPair = _uniswapV2Pair;
        _mint(OwnerAddress, totalSupply);

        _setAutomatedMarketMakerPair(_uniswapV2Pair, true);

        excludeFromFees(owner(), true);
        excludeFromFees(marketingAddress, true);
        excludeFromFees(address(this), true);

    }

    receive() external payable {}

    function updateUniswapV2Router(address newAddress) public onlyOwner {
        require(newAddress != address(uniswapV2Router), "The router already has that address");
        uniswapV2Router = IUniswapV2Router02(newAddress);
        address _uniswapV2Pair = IUniswapV2Factory(uniswapV2Router.factory()).createPair(address(this), uniswapV2Router.WETH());
        uniswapPair = _uniswapV2Pair;
        _setAutomatedMarketMakerPair(_uniswapV2Pair, true);

    }

    function excludeFromFees(address account, bool excluded) internal {
        _isExcludedFromFees[account] = excluded;
    }

    function excludeFromFeesList(address[] calldata accounts, bool excluded) public onlyOwner {
        for(uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }
    }

    function setAutomatedMarketMakerPair(address pair, bool value) public onlyOwner {
        require(pair != uniswapPair, "The PancakeSwap pair cannot be removed from automatedMarketMakerPairs");
        _setAutomatedMarketMakerPair(pair, value);
    }

    function _setAutomatedMarketMakerPair(address pair, bool value) private {
        require(automatedMarketMakerPairs[pair] != value, "Automated market maker pair is already set to that value");
        automatedMarketMakerPairs[pair] = value;
    }

    function updateGasForProcessing(uint256 newValue) public onlyOwner {
        require(newValue >= 200000 && newValue <= 500000, "GasForProcessing must be between 200,000 and 500,000");
        require(newValue != gasForProcessing, "Cannot update gasForProcessing to same value");
        gasForProcessing = newValue;
    }

    function setSwapAndLiquifyEnabled(bool _enabled) public onlyOwner {
        swapAndLiquifyEnabled = _enabled;
    }
    function setSwapTokensAtAmount(uint256 amount) public onlyOwner {
        swapTokensAtAmount = amount;
    }

    function setMarketingWalletAddress(address _marketingAddress) public onlyOwner {
        excludeFromFees(_marketingAddress, true);
        marketingAddress = _marketingAddress;
    }

    function startAddLP() external onlyOwner {
        require(0 == startAddLPBlock, "startedAddLP");
        startAddLPBlock = block.number;
    }


    function startTrade() external onlyOwner {
        require(0 == startTradeBlock, "startTrade");
        startTradeBlock = block.number;
    }

    function setAccountBlack(address _account, bool _isBlack) external onlyOwner {
        require(_account != address(0), "is no Zron");
        _blacklist[_account] = _isBlack;
    }

    function setAccountBlackList(address [] memory accountList, bool _isBlack) external onlyOwner{
        require(accountList.length > 0, 'lendth lg 0');
        for(uint i; i < accountList.length; i++){
          _blacklist[accountList[i]] = _isBlack;
        }
    }


    function setFee(uint256 _buy, uint256 _sell ) external onlyOwner {
        buyFee = _buy;
        sellFee = _sell;
    }


    function claimToken(address stoken, address recipient, uint256 amount) external onlyOwner {
        require(recipient != address(0), "zero_address");
        uint256 balance = IERC20(stoken).balanceOf(address(this));
        if (balance > 0) {
            IERC20(stoken).transfer(recipient, balance > amount? amount : balance);
        }
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        require(!_blacklist[from], 'is Black');

        if(amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        uint256 contractTokenBalance = balanceOf(address(this));
        bool canSwap = contractTokenBalance >= swapTokensAtAmount;
        if( canSwap && !swapping && !automatedMarketMakerPairs[from] && from != owner() && to != owner() && swapAndLiquifyEnabled && from != address(uniswapV2Router)) {
            swapping = true;
            uint256 SwapAmount = contractTokenBalance;
            if(SwapAmount > 0 ) swapAndSendToFee(SwapAmount);
            swapping = false;
        }

        bool takeFee = !swapping;

        if(_isExcludedFromFees[from] || _isExcludedFromFees[to]  ) {
            takeFee = false;
        }

        if(takeFee) {

          uint256 Fee;
          uint256 feeRate;

          if(automatedMarketMakerPairs[from] || automatedMarketMakerPairs[to] ){
            feeRate = automatedMarketMakerPairs[from]  ? buyFee : sellFee;
            if (0 == startTradeBlock) {  require(0 < startAddLPBlock && automatedMarketMakerPairs[to], "!startAddLP"); }
          }
          Fee = amount.mul(feeRate).div(taxTotleFee);
          if(Fee > 0){
            super._transfer(from, address(this), Fee);
            amount = amount.sub(Fee);
          }
        }

        super._transfer(from, to, amount);


        if(!swapping) { }
    }


    function swapAndLiquify(uint256 tokens) private {
        uint256 half = tokens.div(2);
        uint256 otherHalf = tokens.sub(half);

        uint256 initialBalance = address(this).balance;
        swapTokensForEth(half);
        uint256 newBalance = address(this).balance.sub(initialBalance);
        addLiquidity(otherHalf, newBalance);
        emit SwapAndLiquify(half, newBalance, otherHalf);
    }


    function swapAndSendToFee(uint256 TokenAmount) private  {
        swapTokensForEth(TokenAmount);
        uint256 initialBalance = address(this).balance;
        if(initialBalance > 0){
           payable(marketingAddress).transfer(initialBalance);
        }
    }

    function addLiquidity(uint256 tokenAmount, uint256 ethAmount) private {
        uniswapV2Router.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0,
            0,
            address(0),
            block.timestamp
        );

    }

    function swapTokensForEth(uint256 tokenAmount) private {

        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(this),
            block.timestamp
        );

    }

    function swapTokensForCake(uint256 tokenAmount) private {

        address[] memory path = new address[](3);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();
        path[2] = rewardToken;

        uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens( tokenAmount, 0, path , address(tokenDistributor), block.timestamp  );
        uint256 initialUSDTBalance = IERC20(rewardToken).balanceOf(address(tokenDistributor));
        IERC20(rewardToken).transferFrom(
            address(tokenDistributor),
            address(this),
            initialUSDTBalance
        );
    }

}

